template<typename Scalar, int output_size, typename ActFun>
inline void Dense_simple_mlp_01(Scalar* __restrict outputs, const Scalar* __restrict inputs, const Scalar * __restrict weights, const Scalar * __restrict biases, int input_size, ActFun activation_function, Scalar alpha) noexcept 
{
    for(int i = 0; i < output_size; ++i){
        Scalar sum = 0;
        
        for(int j = 0; j < input_size; ++j){
            sum += inputs[j] * weights[j * output_size + i];
        }
        sum += biases[i];
        activation_function(outputs[i], sum, alpha);
    }
}

template <typename Scalar, int size>
inline void BatchNormalization_simple_mlp_01(Scalar * __restrict outputs, const Scalar * __restrict inputs, const Scalar * __restrict gamma, const Scalar * __restrict beta, const Scalar * __restrict mean, const Scalar * __restrict variance, const Scalar epsilon) noexcept
{
    
    for (int i = 0; i < size; ++i)
    {
        outputs[i] = gamma[i] * ((inputs[i] - mean[i]) / std::sqrt(variance[i] + epsilon)) + beta[i];
    }
}

template <typename Scalar, int size>
inline void UnitNormalization_simple_mlp_01(Scalar * __restrict outputs,
                              const Scalar * __restrict inputs,
                              Scalar epsilon) noexcept
{
    Scalar sum_sq = 0;
    for (int i = 0; i < size; ++i) 
    {
        sum_sq += inputs[i] * inputs[i];
    }
    Scalar inv_norm = Scalar(1) / std::sqrt(sum_sq + epsilon);
    for (int i = 0; i < size; ++i) 
    {
        outputs[i] = inputs[i] * inv_norm;
    }
}

template <typename Scalar, int size>
inline void LayerNormalization_simple_mlp_01(Scalar * __restrict outputs, const Scalar * __restrict inputs, const Scalar * __restrict gamma, const Scalar * __restrict beta, Scalar epsilon) noexcept
{
    Scalar mean = 0;
    Scalar variance = 0;
    
    for (int i = 0; i < size; ++i)
    {
        mean += inputs[i];
    }
    mean /= size;
    
    for (int i = 0; i < size; ++i)
    {
        variance += (inputs[i] - mean) * (inputs[i] - mean);
    }
    variance /= size;
    
    for (int i = 0; i < size; ++i)
    {
        outputs[i] = gamma[i] * ((inputs[i] - mean) / std::sqrt(variance + epsilon)) + beta[i];
    }
}

